      txt: "Kubilay is a helpful and caring host. He gave us clear instructions on how to get from the airport, met us at the metro station and took home. A nice variety of fruit and nuts was offered for breakfast. He provided my mum and her friend with a nice room with two single beds, they had also had a choice to sleep in separate rooms. The accommodation is clean with everything you need. It's quite close to the city center and cheap to get there with a transport card that Kubilay provides. Kubilay is an open-minded well-travelled person who will give you all necessary information on sightseeing and not only. Though my mum doesn't speak English, he managed to explain to her where to find traditional hammam and massage so she and her friend were very happy. Thanks for a great stay, Kubilay!\r\n\r\nЗамечательный заботливый хозяин! Четко объяснил, как проехать к нему от аэропорта, встретил у метро, был все время на связи. Комнаты чистые со всем необходимым. Кубилай предоставил моей маме и ее подруге выбор: спать в одной комнате с 2-мя кроватями или в разных комнатах. Несмотря на то, что моя мама не говорит по-английски, Кубилай сумел объяснить ей, где находится хамам и массаж, чем она была очень довольна! Расположение квартиры удобное, добираться до центра легко и недорого с транспортной картой, которую предоставляет Кубилай. На завтрак Кубилай предложил нам фрукты, орехи, сыр и вкусный чай со сладостями. Спасибо ему большое за радушный прием, информационную поддержку и готовность помочь в любую минуту!",
