      txt: "Ann is a great host. We felt welcome. She is a local historian and gave us a great insight into the island. \r\nThe place and location are good. We felt at home. We were very warm at night and it was quite romantic for us. \r\nWe were on the island for other reasons and would recommend it to others, although I would say that it is fully priced. ",
