      txt: "Ann was a very welcoming a thoughtful host. Also a great local historian who shared stories of the early days of the island. The hot breakfast with ham, cheese, fresh fruit and croissants and a perfect egg was a particular highlight. \r\n\r\nHighly recommended! A++\r\n\r\nThe island itself is small and delightful, with the ferry ride across at dusk just lovely. We also highly recommend hiring a tinnie from Brooklyn to explore the river.",
