      txt: "Lluis is the perfect host, with great communication beforehand and a very warm welcome, he was also really flexible and understanding at check out too.\r\n\r\nThe apartment is really well located and as shown in the pictures very clean, tidy and stylish.\r\n\r\nThe apartment has great facilities, the kitchen is fully stocked (not the we needed to use it with so many great restaurants) and the shower was fantastic.\r\n\r\nThe beds are really comfortable, and the rooms very quiet (if you have the windows closed) and there is air con.\r\n\r\nI would definitely book this place again and look forward to returning.\r\nHuge thanks!",
