      txt: "The Hina Room was comfortable, spacious, and had a great breeze. The in-room bathroom is sufficient, but there is limited privacy because there is no door. I appreciated the vanity in the room. \r\n\r\nThe shared areas where clean and in good shape. The kitchen was well stocked with supplies.\r\n\r\nThe host took care to provide the kinds of things you might want on your trip, but not might not have packed -- hair dryer, iron, beach chairs, towels, cooler, etc. That was very thoughtful and I appreciated that touch.",
