      txt: "I had a great stay in Paia at Hoku's bed and breakfast. This location is wonderful because it's central to the Road to Hana, Mt Haleakela, and beaches on the West and Southern shores. Not to mention that the town of Paia has a very old school vibe that was fun to hang out in and be away from the touristy resort scene. Our stay with Hoku was convenient and our needs were immediately addressed. I would stay again when I come back to Maui. Mahalo!",
