      txt: "Karen and Joshua could not have been more gracious hosts. As advertised, they offered a private and very cozy room and gave full access to their kitchen and facilities.  They were friendly and seemed always ready to be of help if I needed it.  Moreover, they had it worked out almost to the last detail:  when I arrived they already had neat packages, clearly labelled, of take-out menus for area restaurants, they had directions to local shops and businesses - all of which were in walking distance, and they had clear directions to the nearby subways, and there was a list of house rules - none of which were unacceptable. Overall, it was like spending a weekend at a friend's place.  The neighborhood was quite busy with people and shops until late into the night, but the room was quiet, clean and comfortable.  I slept like a baby.  I would only suggest that you confirm your check in and check out times with them in advance so as to avoid any confusion. I would stay here again if I needed to take another trip to NYC in the future - for sure.",
