      txt: "The place was spacious and comfortable but the best part about it is the location. It's in the center of town, making all the major destinations easily accessible. In addition, Ali and Joanne were very accommodating with our early check in. The amenities, however, were lacking. We were hoping to shower after our long flight but there were no bath towels when we arrived. I texted Ali and the towels were delivered while we were out for lunch. There was only one tube of shampoo and conditioner provided that were clearly taken from hotels. There was a bar of soap for bathing and it had obviously been used before. The previous things I can deal with, but for our 5 night stay for 2 people, there was only one and a half rolls of toilet paper. I texted Ali for toilet paper, shampoo, and soap twice, but received no response.\r\n\r\nI loved the apartment, but it needs to be better stocked.",
