      txt: "It was really a pleasure having stayed at Jessa's apartment. Me and my family had a comfortable stay. Jesse and Kris have been very responsive to my concerns and made sure things were properly communicated. \n\nSpecial thanks to Kris who has been so accommodating and approachable.\n\nGood points:\n1) Apartment is conveniently located near MTR exit (less than 5-min walk)\n2) A nearby supermarket to get your daily needs like water\n3) A LOT of restaurants nearby including local eateries. There's even a Korean resto! (Seng Seng)\n4) Strong water supply with instant hot water\n5) Comfy beds and pillows\n6) Well-equipped kitchen with a complete set of glassware\n7) Umbrellas. It was raining on our 2nd day and the umbrellas came in handy.\n\nRoom for improvement:\n1) Directions on how to get to the meeting place e.g. which exit to take from MTR exit as there were lots of exits\n2) Standardised ON/OFF light switches\n3) Working clock in at least one of the rooms, if not all\n\nThanks again Jessa and Kris! We would definitely recommend your apartment/s to our families and friends.",
