      txt: "Nous avons passé un très bon séjour à Hong Kong logeant à l'appartement de Jessa dans le quartier de Kowloon. Ce dernier est idéalement placé (proche de 2 stations de métro, restaurants et commerçants à profusion autour de l'immeuble). L'appartement en lui-même est très fonctionnel, la literie en latex très confortable. \nLes points négatifs ont été l'absence de rideaux occultants dans les chambres (il fait jour vers 7h du matin). À cela s'est ajouté la présence d'un chantier au pied de l'immeuble, causant du bruit du lundi au samedi à partir de 8h du matin.\nWe spent a very nice time in Hong Kong sleeping in Jessa's flat in Kowloon. It is really well situated next to 2 tube stations, and restaurants and shops run all around the building. The flat in itself is really functional, the latex beds are very comfortable.\nThe only bad points were the lack of thick curtains in the bedrooms (sun rises à 7 o'clock in the morning). There were also a construction site next to the building, making noise starting at 8 o'clock in the morning, from mondays to saturdays.",
