      txt: "We enjoyed a two-night stay with Nuria in Barcelona.  Her listing is very accurate and we found everything as advertised.  Her apartment is in a good location, only a 10-minute walk from Lesseps Metro Station.  The Gaudi Guell Park is an uphill walk of about 900 meters.  Our room and bathroom were clean and the beds comfortable for our family of three.  The internet worked well and her rooftop terrace was pleasant for afternoon tea and breakfast.  In fact, Nuria offered us tea on the roof upon our arrival.  We enjoyed having use of the kitchen during our stay.  The elevator in her building was nice for carrying luggage up and down.  Our Spanish and Nuria’s English were minimal, but we were able to communicate.  This is certainly not a luxurious place, but good for those traveling within a budget.   ",
