      txt: "My husband, 11 year old son and I had a great stay at Toby and her sister Libby's place. The apartment is as advertised--very sweet with two small balconies, a full service kitchen (including spices), and an air-conditioner, as some of the stand-outs (and the latter was very helpful in July). The thing is that you won't want to spend that much time there because the neighborhood is amazing--which was also accurately advertised. We walked or took the metro everywhere and never used our car (we lucked out and found a parking spot right after the street had been cleaned and all the other cars had to move). There are so many great restaurants, cafes and boutiques nearby, and also a sweet park right at the top of the street. We walked to Mont Royal (and then walked to the top for an amazing view), and walked to the Metro stop to get to downtown (for free concerts at the Jazz Festival), the old port, and the Jean Talon market. Also, Libby was very helpful and available via email (and if my phone worked, I assume text as well); has lots of maps and brochures in the apartment for you to look at and use; and her housecleaner, who met us and gave us the keys, was lovely and full of tips about the city. We can't wait to come back and explore more! ",
