      txt: "Our stay in Jared's apartment was exactly what we needed. It's a very comfortable space for two people. There is a big window that provides a nice view of the surroundings and a lovely breeze. We didn't use the rooftop pool (too cold) but it was gorgeous! The kitchen is very small but it's well set out so there is still plenty of bench space. Being on a high floor the hot water doesn't run for particularly long but it's fine if you leave a bit of time between showers. Checking in and out was super easy! The building is in a wonderful location, we walked easily to Haymarket, Darling Harbour, the Rocks, and Circular Quay. TIP: If you are driving into the city, this is not the place to stay. Parking was a nightmare. Jared does warn that parking is expensive (he mentions $69 in the apartment description) but what I didn't realise is it's not just a $69 flat rate for more than three hours, it's $69 the first day, $50 overnight, then $69 for the next day. In the end we just gave up trying to find cheaper parking and paid. Other than that our stay was wonderful. Thank you Jared for being a wonderful host! ",
