      txt: "This was the perfect rental for my husband and I. This is our first AirB&B rental and we were pleasantly surprised! The views of the ocean were amazing, the resort is well kept and the landscaping is beautiful. Turtles were in the ocean at the edge of the property every morning, and we were usually able to scurry down with coffee or a mimosa and watch them swim and come up for air. The pool was rarely, if ever, used during our stay, so you could have it all to yourself. The BBQ are was clean and well-kept. This condo is on the third floor with stairs up, so if you have physical limitations it might be a struggle. However, the third floor placement allows for extremely quieter accommodations and an unparrelleled view of the ocean. The bedroom is on the street side, so road noise does creep in during the evenings. We easily slept and the noise didn't bother us at all. The fans and open windows kept us cool during the evenings with no need for AC (this unit does not have it). Although we didn't meet Ken in person, he provided us with all the information we needed to enjoy the condo without worry. This place is well stocked, clean and convenient. Highly recommended.",
