      txt: "A quem estiver indeciso em relação à estadia na casa. \r\nDecidam bem, decidam pela Casa da Porta Amarela (ou vermelha ou azul). Uma decoração personalizada, pensada e acolhedora. 4 pessoas ficam aqui à vontade. Tem tudo o que é preciso e mais. Lençóis e quartos muito cheirosos. Tranquilo.\r\nLocalizada a alguns minutos do centro mas para nós não foi problema andar. Vale a pena aqui ficar, pela casa, pelos anfitriões. \r\nObrigada por tudo! Hei-de voltar.\r\n\r\nDon't look anywhere else. Just stay here, you'll have everything to make your stay even better. A house where you wish you could live. Very quiet, just like the pictures with an  amazing decor. I love Porto and I want to stay here when I visit again. \r\n",
