      txt: "l appartement est situé dans une rue résidentielle très calme en restant très proche du centre.\nNombreux petits commerce autour donc très pratique pour vivre comme un habitant de porto\n\nTrès joli appartement bien décoré,très propre et très bien équipé (cuisine avec tout le nécessaire ,machine a laver, wifi y compris une cafetière nespresso)\nLe gros plus de cet appartement est une magnifique terrasse fleurie en cours intérieure et sans vis à vis qui permet de se relaxer en extérieur.\n\nl accueil par la propriétaire est excellent,elle a été très disponible .Nous avons reçu plein d information sur les choses à visiter,les bonnes adresses.\n\nDans le futur je choisirais a nouveau cet appartement",
