      txt: "Hemos estado muy agusto en este piso! Estamos muy gratamente sorprendidos!\r\nEl barrio no puede tener mas encanto, centrico, con mucha vidilla, cerca de todo, en fin ideal para unos dias en barcelona. \r\nEl piso es muy mono pero ademas muy muy comodo. \r\nLos anfitriones un encanto que se han volcado con nosotros \r\nYo les doy un 10! ",
