      txt: "The apartment is beautiful, immaculate and well located, a short walk from Sao Bento station and walking distance from most sights in Porto and the riverfront.  The welcome gift was appreciated, the kitchen was well equipped (although we ate out and didn't need to use it) and the apartment was exactly as described.  Isabel was a gracious host who kept in good communication.  There was a small issue with check-in (the concierge was late to drop off our keys) and if you are a light sleeper you may want to bring earplugs as noise from the upstairs neighbours tended to reverberate through the floorboards.  Overall, it was an excellent base for our short stay in Porto (far more authentic and beautiful than a hotel room) and we would be happy to return. Thank you.",
