      txt: "Our stay was very pleasant. The apartment was spacious and well equipped with fridge freezer, washing machine, hair dryer and kettle. The apartment was clean and located 3-5 minute walk from Sao Bento Railway station and 10 minute walk to the bus station. It is near all the major sites and a 15 minute walk to The Riberia with restaurants, boat trips and Port caves. \nThe only suggestion would be for the concierge management, in that we were booked for a 15:30 check- in and were left waiting outside until 16:20 on the footpath/sidewalk until Louisa from the management company arrived, I understand traffic can be a problem, but would have appreciated a text or phone call as to the delay. I had to message the management service to find out any information and was only told someone was on the way - but no time indication.\nWe asked where would we find a grocery store and again Louisa did not have this information, nor recommendations. \nThe door to the apartment jammed and she could not get it opened, luckily my husband was able to 'pound' on the door to help us get in. When we tested the door to get out of the apartment again, she was unable to open the door. If my husband had not been with me, I or any women would not be able to get in or out of the apartment. Louisa said she would report this problem and hopefully, it will be resolved before the next people arrive. \nI would recommend this apartment when visiting Porto for location, and general facilities in the apartment. ",
