      txt: "The perfect spot for a surfer to land as The Cove is directly across the street and checking the surf from the room with a cup of coffee was the early morning ritual :) Awesome backyard with pool and shower area. A most enjoyable walk to great food like Kihei Cafe for breaky and South Maui Fish Company Food Truck for the best fish tacos. \r\n\r\nComfortable beds with plenty of pillows, lots of beach necessities in unit, and easy parking make this a perfect spot for families or a couple like us. \r\n\r\nJennifer was easy to work with and very responsive and accommodating! Will be back for sure! ",
