      txt: "Jennifer's place has everything you need in the perfect location. It was my first time in Maui, & I absolutely enjoyed it. Jennifer's place was literally right across the street from Kalama Beach Park & a very short walk (~10 min.) from Charley Young Beach. Her place is very centrally located in Kihei: directly next to the surf/paddleboard rental, 5 min. walking distance from a shopping village, & in the middle of the island, which is nice if you plan on doing the drives to Mt. Haleakala or the Road to Hana. Safeway is a short ~5 min. drive & Costco & the airport are a ~30 minute drive away. Her place has everything you need: kitchen, washer/dryer, beach towels/chairs, nice outdoor patio with a nice, small pool. I highly recommend her place if you want a quiet, quaint, peaceful place to relax where everything you need is a short distance away. Jennifer was also very prompt in her responses and very easy to get a hold of. Thanks again for everything, Jennifer!!! My family & I loved everything about our stay at your place.",
