      txt: "We're grateful to Chas and Paul being were flexible and accommodating with our arrival / departure times and our queries over the first day or so.  \r\nThe description and pictures were accurate and the apartment was well-maintained and very neat and clean.  The mezzanine floor is best suited for storage or sleeping arrangements for children or understanding teens or adults.\r\nThe upper West Side felt very safe at all times and the apartment was on the same block for the subway stops for B and C trains and a short walk to restaurants / cafes on Columbus and Amsterdam.  Overall, the apartment offered a genuine feeling of how it would be to live as a New Yorker, rather than a hotel tourist.  Highly recommended.",
