      txt: "The apartment is located on the corner of the main street of Barcelona, which is super convenient to access all the major sightseeings, restaurants and shopping area of the city within 2-3 kilometers. \n\nIt's a really warm and tidy apartment with modern design and classic layout. It has a big dinning room with a super cute balcony, sitting where you can have a cup of coffee and relax for reading. Two bedrooms and two individual bathrooms are quite decent for a family and two couples of friends to stay. \n\nAlex and Schwartz are very helpful to offer clear instructions and quick response whenever questions were sent. \n\nIt's impressive living experience and I highly recommend to all who gonna come to Barcelona for traveling.",
