      txt: "I just booked a room for a night, before taking my flight. So I can't fully describe Dama's House. However, I can say Ali is a very very nice guy, he welcomed me very well. The room was clean, small but pretty and well arranged. Idem for the bathroom. About the location, it's nearby Karakoy's port (from there, you can go to Uskudar etc.) and nearby Istikal, a famous shopping street going to Taksim (a center place to take a bus and to go to the airport for example).\r\nFinally I can recommend Ali and Dama's House ;)",
