      txt: "Ali was very communicative before I arrived in Istanbul, gave very clear directions to the apartment, and was welcoming and accessible throughout my stay.  The room itself--the grey room--was simple and lovely, in an apartment ideally located in Beyoglu within easy walking distance of everything I needed.  Perfect.  Ali also arranged reliable early morning transport to Ataturk airport for me on the day of my departure.  It was a really great place to stay, private and simple and friendly.  Strongly recommended.  ",
