      txt: "Ali was a great host. Very friendly and helpful. I stayed a week in the Grey Room. After a warm welcome, Ali gave me a street map of Istanbul and a nice present. The Location is just two minutes away from Istiklal Cad., very cool! Thank you Ali, for sharing your place. ",
