      txt: "I had a very good experience at Dama house during my holidays in Istanbul. It's very central and that allowed me to walk to almost everywhere. The house is in a quiet street and it has all the facilities, also Ali has been always very quick replying to any questions and very easy person to deal with. I will definitely stay again there in my next trip to Istanbul.",
