      txt: "Ali was great from day one - gave me all the information and help I could've possibly wanted and welcomed me personally to the flat. He even went the extra step to ask me whether I needed anything on my day of departure such as a taxi to the airport. The room is just as described and perfect for a single person travelling for a short period of time. What made the experience especially special was meeting the other young people living in the flat who were great and with whom I had a fab weekend!",
