      txt: "Jons und Lisas sehr schönes und gemütliches Brownstonehouse liegt in Fort Greene in Brooklyn. Wir mochten die Umgebung sehr und haben die vielen kleinen Cafes und die tollen Restaurants sehr genossen. Vor allem WALTERS in der Dekalb Ave.\r\nIm Haus in der St Felix Street haben wir uns von der ersten Sekunde an wohl gefühlt und haben unsere Wahl in den neun Tagen unseres Aufenthalts kein einziges mal bereut. Jon hat uns im Vorfeld sehr viele gute Tips die Gegend betreffend gegeben und hat uns den Schlüssel sogar per FedEx nach Berlin geschickt.\r\nIm Haus selber ist genug Platz, wenn man zu viert anreist hat jeder ein eigenes Schlafzimmer, es ist aufgeräumt und sauber, das Internet funktioniert einwandfrei und in der Küche macht es großen Spaß zu kochen...\r\nall thumbs up!!! ",
