      txt: "Stayed at Sabrina's place for almost a week.  As I need to checked in early due to young kids, Sabrina was helpful in granting early check-in :) \r\nThe place was neat and clean upon check-in. Initially there was only one heater and request to have extra heaters were met on the same day. Sabrina bought two new heaters and I am very thankful for that.  Another good thing that happened was the new wifi installed ;) \r\nLocation wise is very good. Minutes walk to Darling Harbour and the Central Station Light Rail. Bus 389 is round the corner to take you to the Sydney CBD which is only one stop away. \r\nGenerally we enjoyed Sabrina's place and will go back again. \r\n",
      rate: 5,
