      txt: "We had the good fortune to stay in this amazing apartment for 4 nights while vacationing in the city for our 25th wedding anniversary.  The apartment is just as it appears in the photos: impeccably clean, modern, updated and cozy.  The bed and pillows were incredibly comfortable and provided a restful nights sleep after long days exploring the city.  Our adult daughter slept on the futon, and she was in heaven!  There were extra pillows, sheets and a comforter in the closet, and I'm not exaggerating when I say that she was more comfortable here than in the hotel room we stayed at during our first half of our trip.  The apartment had everything we needed: dishes, Keurig coffee and coffee maker (my #1 priority!), iron, hair dryer and much, much more!  There was a fantastic bottle of Pinot Noir that I thoroughly enjoyed and a jar full of Hershey's kisses (which we ate entirely too many of)!  Evan and Maria thought of everything; there is even an iPhone charger to use!  For NYC, it was very quiet and peaceful, which came as a pleasant and unexpected surprise to us.  The location can't be beat, close to great restaurants, parks,  & subways.  I'm sure I'm forgetting something, but let me end by saying that this apartment is so great that I want to live in it!  In fact, our daughter hopes to relocate to the city soon, and she took note of just how well Evan and Maria utilized the space and all the most wonderful details.  Well done.  Bravo!!!",
